import React from 'react';


const ContactUs = (prop) => {



    return (
        <section className="content-block quotation-block black-overlay-6 parallax" data-stellar-background-ratio="0.55">
        <div className="container">
            <div className="inner-wrapper">
                <h3 className="block-top-heading text-white">WE PLACE</h3>
                <h2 className="text-white">THE RIGHT PEOPLE AT THE RIGHT PLACE</h2>
                <div className="btn-container">
                    <a href="contact.html" className="btn btn-primary has-radius-small">CONTACT US</a>
                </div>
            </div>
        </div>
    </section>
    )
  }

  export default ContactUs;
